# Kiler, Republic of Dagestan

}}
Kiler (; ) is a rural locality (a selo) in Kilersky Selsoviet, Dokuzparinsky District, Republic of Dagestan, Russia. The population was 395 as of 2010. There are 2 streets.
Geography
Kiler is located 6&nbsp;km south of Usukhchay (the district's administrative centre) by road. Kerimkhanar and Gandurar are the nearest rural localities.
